import React from "react";
import './index.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
// import NotFound from "./pages/NotFound";
import Navbar from "./components/Navbar";
import Dashboard from "./components/Dashboard";
import AssignDriverForm from "./components/AssignDriverForm";
import ExpenseLogger from "./components/ExpeneseLogger";
import InvoiceGenerator from "./components/InvoiceGenerator";
import TripPlanner from "./components/TripPlanner";

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/components" element={<AssignDriverForm />} />
        <Route path="/expenselogger" element={<ExpenseLogger/>}/>
        <Route path="/invoice" element={<InvoiceGenerator/>}/>
        <Route path="/tripplanner" element={<TripPlanner/>}/>
        <Route path="/vehicleform" element={<Veh/>}/>

      </Routes>
    </Router>
  );
};

export default App;
